function gently_extract_error_msg(e) {
    if (typeof(e) === 'string') {
        return e;
    }
    let msg = e.message;
    if (e.response) {
        msg = e.response.data || e.response.statusText;
    }
    return msg;
}

function trim_long_string(s, limit_len) {
    const trimmed_string = s.length > limit_len ?
        s.substring(0, limit_len - 6) + "..." + s.substring(s.length-3, s.length) : s;
    return trimmed_string;
}

function current_user(){
    const el = document.getElementById('user-data');
    if (el){
        return JSON.parse(el.textContent) || null
    }
    else {
        return null
    }
}

function secs_delta_to_string(secs){

    if (secs === null) {
        return ''
    }
    const hours = Math.floor(secs / (60 * 60));

    const divisor_for_minutes = secs % (60 * 60);
    const minutes = Math.floor(divisor_for_minutes / 60);

    const divisor_for_seconds = divisor_for_minutes % 60;
    const seconds = Math.ceil(divisor_for_seconds);

    let items = [];
    if (hours > 0) {
        items.push( hours.toString() + ' ч.')
    }
    if (minutes > 0) {
        items.push( minutes.toString() + ' мин.')
    }
    if (seconds > 0) {
        items.push( seconds.toString() + ' сек.')
    }
    return items.join(' ')
}

