Vue.component(
    'account-fields-form',
    {
        emits: ['on_edit', 'on_submit'],
        delimiters: ['[[', ']]'],
        props: {
            initial: {
                type: Object,
                default(){
                    return {
                        icon: null,
                        first_name: null,
                        last_name: null,
                        phone: null,
                        email: null,
                        telegram: null
                    }
                }
            },
            submit_enable: {
                type: Boolean,
                default: true
            },
            required_fields: {
                type: Array,
                default(){
                    return ['first_name']
                }
            },
            disabled_fields: {
                type: Array,
                default(){
                    return []
                }
            },
            phone_mask: {
                type: String,
                default: '+{7}(000)000-00-00'
            },
            telegram_mask: {
                type: String,
                default: '{@}*'
            },
            align: {
                type: String,
                default: 'center'
            }
        },
        data() {
            return {
                model: null,
                labels: {
                    required_field_error: 'Обязательное поле',
                    name_settings: 'Отображаемое имя',
                    contacts_settings: 'Контакты',
                    auth_settings: 'Настройки авторизации'
                },
                masks: {
                    phone: null,
                    telegram: null
                },
                loading: false,
                error_msg: null,
                success_msg: null,
                disabled: false
            }
        },
        mounted () {
            this.model = this.initial;
        },
        updated(){
            const $inputs = $(this.$refs.form).find('input');
            const self = this;
            $inputs.toArray().forEach(function (el) {
                if (self.disabled_fields.indexOf(el.id) >= 0) {
                    el.disabled = 'on'
                }
                if (el.id === 'phone') {
                    self.masks.phone = IMask(
                        el,
                        {
                          mask: self.phone_mask
                        }
                    );
                }
                if (el.id === 'telegram') {
                    self.masks.telegram = IMask(
                        el,
                        {
                          mask: '{@}***************************************'
                        }
                    );
                }
            });
        },
        methods: {
            on_edit(){
                this.$emit('on_edit', this.model)
            },
            on_submit(){
                this.$emit('on_submit')
            },
            validate(){
                const $inputs = $(this.$refs.form).find('input');
                const self = this;
                let success = true;
                $inputs.toArray().forEach(function (el) {
                    if (!success) {
                        return
                    }
                    if (self.required_fields.indexOf(el.id) >= 0) {
                        if (el.value) {
                            el.setCustomValidity("");
                        }
                        else {
                            el.setCustomValidity(self.labels.required_field_error);
                            el.reportValidity();
                            success = false;
                        }
                    }
                    else if (! el.checkValidity()) {
                        el.reportValidity();
                        success = false;
                    }
                });
                return success;
            },
            set_loading(on) {
                this.loading = on;
            }
        },
        template: `
            <div class="p-2">
                <div class="row">
                    <div class="col" v-if="align != 'left'"></div>
                    <div class="col-auto">
                        <form ref="form" v-if="model" class="border border-secondary border-opacity-50 p-3">
                          <div class="mb-5">
                            <div >
                                <h6 class="text-primary border-bottom">
                                    [[ labels.name_settings ]]
                                </h6>
                            </div>
                            <div class="row">
                                <div class="col">
                                    <label for="first_name" class="form-label">Имя</label>
                                    <input :disabled="disabled" @input="on_edit" v-model="model.first_name" type="text" class="form-control" id="first_name" aria-describedby="firstNameHelp">
                                </div>
                                <div class="col">
                                    <label for="last_name" class="form-label">Фамилия</label>
                                    <input :disabled="disabled" @input="on_edit" v-model="model.last_name" type="text" id="last_name" class="form-control" aria-describedby="lastNameHelp">
                                </div>
                            </div>
                          </div>
                          <div>
                                <h6 class="text-primary border-bottom">
                                    [[ labels.contacts_settings ]]
                                </h6>
                            </div>
                          <div class="mb-3">
                            <div class="row">
                                <div class="col">
                                    <label for="phone" class="form-label">Phone</label>
                                    <input :disabled="disabled" @input="on_edit" v-model="model.phone" type="phone" class="form-control" id="phone" placeholder="+7(911)-333-22-11">
                                </div>
                                <div class="col">
                                    
                                </div>
                            </div>
                          </div>
                          <div class="mb-3">
                            <div class="row">
                                <div class="col">
                                    <label for="email" class="form-label">Email</label>
                                    <input :disabled="disabled" @input="on_edit" v-model="model.email" type="email" class="form-control" id="email" placeholder="iam@server.com">
                                </div>
                                <div class="col">
                                    
                                </div>
                            </div>
                          </div>
                          <div class="mb-3">
                            <div class="row">
                                <div class="col">
                                    <label for="telegram" class="form-label">Telegram</label>
                                    <input :disabled="disabled" @input="on_edit" v-model="model.telegram" type="text" class="form-control" id="telegram" placeholder="@mytelegram">
                                </div>
                                <div class="col">
                                    
                                </div>
                            </div>
                          </div>
                           <!----->
                          <div class="text-center" >
                            <span class="text-success">[[ success_msg ]]</span>
                          </div>
                          <div class="text-center" style="min-height:120px;">
                            <button v-if="submit_enable && !loading" @click.prevent="on_submit" type="submit" class="btn btn-primary">Обновить</button>
                            <loader-circle style="max-height: 30px;" v-if="loading"></loader-circle>
                            <br/><span v-if="error_msg" class="text-danger">[[ error_msg ]]</span>
                          </div>
                        </form>
                    </div>
                    <div class="col" v-if="align != 'right'"></div>
                </div>
            </div>
        `
    }
);

